import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import NoteEntry from "./Note";
import notes from "../notes";

function newEntry(notes){
  return (
    <NoteEntry 
    key={notes.id}
    title={notes.title}
    content={notes.content}
    />
  );
}


function App() {
  return (
    <div>
      <Header />
      {notes.map(newEntry)}
      <Footer />
    </div>
  );
}

export default App;
